import React, { useState } from "react";

export default function Intro(props) {
  const [test, setTest] = useState("");

  const onChangeTest = (e) => {
    setTest(e.target.value);
  };

  const startTest = () => {
    alert("검사를 시작합니다");
    props.history.push("/test");
  };

  return (
    <div>
      <h1>검사예시</h1>

      <p>
        직업과 관련된 두 개의 가치 중에서 자기에게 더 중요한 가치에 표시하세요.
        <br />
        가치의 뜻을 잘 모르겠다면 문항 아래에 있는 가치의 설명을 확인해 보세요.
      </p>
      <p>두 개의 가치 중에 자신에게 더 중요한 가치를 선택하세요.</p>

      <div>
        <label>
          <input type="radio" name="test" value="1" onChange={onChangeTest} />
          능력발휘
        </label>
        <label>
          <input type="radio" name="test" value="2" onChange={onChangeTest} />
          자율성
        </label>
      </div>

      <br />

      <button disabled={test == "" ? true : false} onClick={startTest}>
        검사시작
      </button>
    </div>
  );
}
